GM_addStyle(".numpadbtn_double_triple{ font-weight: bold; color: black; z-index: 99; width: 29%; height: 40px; background-color: blue; color: white; padding: 0px 2% 0px 2%;  margin-left: 3%; margin-top: 10px; vertical-align: middle; border-radius: 8px;  border: 1px solid #a9b1cb;}")

